import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import './DataTable.css';

const styles = {
    tableHeader: {
        position: 'sticky',
        top: 0,
        backgroundColor: '#333',
        zIndex: 2,
        borderBottom: '1px solid #444',
    },
    summaryRow: {
        backgroundColor: '#555',
        fontWeight: 'bold',
        position: 'sticky',
        top: 50,
        zIndex: 1,
        color: '#fff',
    },
    imageCell: {
        position: 'relative',
    },
    image: {
        width: 50,
        height: 50,
        transition: 'transform 0.2s',
    },
    imageHover: {
        position: 'absolute',
        width: 150,
        height: 150,
        zIndex: 10,
        transform: 'scale(3)',
        transition: 'transform 0.2s',
    },
    brandCell: {
        maxWidth: 100,
    },
    tableContainer: {
        borderRadius: '10px',
    },
};

class DataTable extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            hoverIndex: null,
        };
    }

    handleMouseEnter = (index) => {
        this.setState({ hoverIndex: index });
    }

    handleMouseLeave = () => {
        this.setState({ hoverIndex: null });
    }

    render() {
        const { data, priceSegments } = this.props;
        const { hoverIndex } = this.state;

        if (!data.length) {
            console.log('No data to display');
            return null;
        }

        console.log('Displaying data:', data);

        return (
            <TableContainer component={Paper} style={styles.tableContainer}>
                <Table>
                    <TableHead>
                        <TableRow style={styles.tableHeader}>
                            {!priceSegments && <TableCell>Image</TableCell>}
                            {!priceSegments && <TableCell>ASIN</TableCell>}
                            {!priceSegments && <TableCell>Title</TableCell>}
                            <TableCell>Price Range</TableCell>
                            {!priceSegments && <TableCell style={styles.brandCell}>Brand</TableCell>}
                            <TableCell>Sales</TableCell>
                            <TableCell>% of Total Sales</TableCell>
                            <TableCell>Revenue</TableCell>
                            <TableCell>% of Total Revenue</TableCell>
                            {!priceSegments && <TableCell>Seller Type</TableCell>}
                            {!priceSegments && <TableCell>Date First Available</TableCell>}
                            {!priceSegments && <TableCell>Category</TableCell>}
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.map((row, index) => (
                            <TableRow key={index} style={row.asin === "Summary" ? styles.summaryRow : {}}>
                                {!priceSegments && (
                                    <TableCell style={styles.imageCell}>
                                        {row.imageUrl && (
                                            <img
                                                src={row.imageUrl}
                                                alt={row.title}
                                                style={hoverIndex === index ? { ...styles.image, ...styles.imageHover } : styles.image}
                                                onMouseEnter={() => this.handleMouseEnter(index)}
                                                onMouseLeave={this.handleMouseLeave}
                                            />
                                        )}
                                    </TableCell>
                                )}
                                {!priceSegments && <TableCell className="table-cell">{row.asin}</TableCell>}
                                {!priceSegments && <TableCell className="table-cell">{row.title}</TableCell>}
                                <TableCell className="table-cell">{row.price}</TableCell>
                                {!priceSegments && <TableCell className="table-cell" style={styles.brandCell}>{row.brand}</TableCell>}
                                <TableCell className="table-cell">{row.sales}</TableCell>
                                <TableCell className="table-cell">{row.percentOfTotalSales}</TableCell>
                                <TableCell className="table-cell">{row.revenue}</TableCell>
                                <TableCell className="table-cell">{row.percentOfTotalRevenue}</TableCell>
                                {!priceSegments && <TableCell className="table-cell">{row.sellerType}</TableCell>}
                                {!priceSegments && <TableCell className="table-cell">{row.dateFirstAvailable}</TableCell>}
                                {!priceSegments && <TableCell className="table-cell">{row.category}</TableCell>}
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        );
    }
}

export default DataTable;
